import React, { useEffect } from 'react';
import styled from 'styled-components';
import Aos from 'aos';
import 'aos/dist/aos.css';
import { arrowPop } from '../../style/keyframes';
const logoURL = '/images/start_logo.png';

const StartLogo: React.FC = () => {

    useEffect(() => {
        Aos.init({ duration: 1500 });
    },[]);

    return (
        <LogoBox>
            <Logo data-aos='zoom-in-up'
                URL={logoURL} />
            <Arrow> âˆ¨ </Arrow>
        </LogoBox>
    )
}

export default StartLogo;

const LogoBox = styled.div`
    width: 900px;
    height: 100%;
    margin-bottom: 300px;
`;

const Logo = styled.div<{ URL: string }>`
    width: 900px;
    height: 900px;
    background-image: url(${({ URL }) => URL});
    background-size: cover;
    background-position: center;
`;

const Arrow = styled.div`
    font-size: 40px;
    text-align: center;
    animation: ${arrowPop} 0.5s alternate infinite;
`;
